import React from 'react';
import classes from './css/input_select.module.css';
const InputSelect=(props)=>{
    const StatusTrue=()=>{
        props.UpdateStatusTrue();//изменение статуса на значение true
    };
    const StatusFalse=()=>{
        props.UpdateStatusFalse();//изменение статуса на значение false
    };
    return <div className={classes.block}>
        <input onFocus={StatusTrue} onfocusout={StatusFalse} type='text' className={classes.input}/>
        <label className={props.label_class}>{props.label_text}</label>
    </div>
};
export default InputSelect;
